          <p>MÖCHTEST DU IHN HABEN? DANN KLICKE UNTEN AUF SICHERN!</p>

            <li><a href="javascript:void(0);">Sichern</a></li>
          </ul>
        </div>
      </div>
    </script>
    <script type="text/template" id="selected-parcel-template">
      <div class="notice-container">
        <div class="notice">
          <p>HERZLICHEN GLÜCKWUNSCH!</p>
          <p>DU BIST JETZT IM BESITZ EINES VIRTUELLEN QUADRATMETER TEMPELHOFER FELD!</p>
          <p>SENDE IHN DIR PER MAIL ZU UND TEILE IHN MIT DEINEN FREUNDEN!</p>
          <ul class="actions">
            <li><a href="javascript:void(0);">Senden</a></li>
            <li><a href="javascript:void(0);">Partizipieren</a></li>
          </ul>
        </div>
      </div>
    </script>
    <script type="text/template" id="reserved-parcel-template">
      <div class="notice-container">
        <div class="notice bad">
          <p>DIESER QUADRATMETER IST SCHON VERGEBEN!</p>
          <ul class="actions">
            <li><a href="javascript:void(0);">Besitzer kontaktieren</a></li>
            <li><a href="javascript:void(0);">Partizipieren</a></li>
          </ul>
        </div>
      </div>
    </script>
    <script type="text/template" id="section-template">
      <%
        var i = 0, newLineClass, reservedClass;

        parcels.forEach(function( parcel ) {
          if(i % QM.Collections.Parcels.MAX_NUM_PARCEL_SQRT === 0){
            newLineClass = ' new-line';
          } else {
            newLineClass = '';
          }

          if(parcel.get('reserved')){
            reservedClass = ' reserved';
          } else {
            reservedClass = '';
          }

      %>
        <li class="parcel<%= newLineClass %><%= reservedClass %>"></li>
      <%
        i++; 
        }); 
      %>
    </script>
